import {
    createBrowserRouter,
    RouterProvider,
    Route,
} from "react-router-dom"
import Home from "./routes/Home";

function App() {
    const router = createBrowserRouter([
        {
            path: "/",
            element: <Home />,
        },
    ]);
    return <RouterProvider router={router} />
}

export default App;
